import React from 'react';
import ContactForm from './ContactForm';
import './ContactForm.css';
import beastmodeLogo from '../img/beastmode.png';

function Home() {
    return (
        <div style={{ minHeight: '100vh', background: '#000', display: 'flex', flexDirection: 'column' }}>
            {/* HEADER */}
            <header style={{ background: '#000', color: '#fff', display: 'flex', alignItems: 'center', padding: '0 32px', height: 80 }}>
                <div style={{ width: 90, height: 70, display: 'flex', alignItems: 'center', justifyContent: 'center', marginRight: 32 }}>
                    <img src={beastmodeLogo} alt="Logo" style={{ width: 70, height: 70, objectFit: 'contain' }} />
                </div>
                <nav style={{ flex: 1 }}>
                    <ul style={{ display: 'flex', listStyle: 'none', margin: 0, padding: 0, gap: 32, fontWeight: 'bold', fontSize: 17, letterSpacing: 1 }}>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>TRANG CHỦ</a></li>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>VỀ CHÚNG TÔI</a></li>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>KẾT QUẢ</a></li>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>SẢN PHẨM</a></li>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>MẶT HÀNG</a></li>
                        <li><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>MỨC GIÁ</a></li>
                    </ul>
                </nav>
            </header>

            {/* FORM ĐỎ */}
            <section style={{ background: '#d32f2f', padding: '32px 0', borderBottom: '6px solid #000', borderTop: '4px solid #000' }}>
                <div style={{ maxWidth: 1200, margin: '0 auto' }}>
                    <ContactForm />
                </div>
            </section>

            {/* PHẦN LIÊN HỆ */}
            <section style={{ background: '#000', flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center', minHeight: 250, position: 'relative', borderBottom: '16px solid #b23b3b' }}>
                <div style={{ width: '100%', display: 'flex', justifyContent: 'flex-end', alignItems: 'center', padding: '0 8%' }}>
                    <button style={{ background: '#d32f2f', color: '#fff', fontWeight: 'bold', fontSize: 22, border: 'none', padding: '28px 48px', borderRadius: 2, cursor: 'pointer', letterSpacing: 1 }}>LIÊN HỆ CHÚNG TÔI</button>
                </div>
            </section>

            {/* FOOTER */}
            <footer style={{ background: '#b23b3b', color: '#000', textAlign: 'left', padding: '24px 40px', fontSize: 20, letterSpacing: 2 }}>
                COPYRIGHT 2025 ©
            </footer>
        </div>
    );
}

export default Home;
